  true,\n\t\"url\": null,\n\t\"notes\": \"EDFacts Title I, 2011-12 (EDFacts T1:2011-12),
  is one of 17 'topics' identified in the EDFacts documentation (in this database,
  each 'topic' is entered as a separate study); program data is available since 2005
  at <ed.gov/about/inits/ed/edfacts>. EDFacts T1:2011-12 (ed.gov/about/inits/ed/edfacts)
  annually collects cross-sectional data from states about student participants and
  staff of Title I, Part A of the Elementary and Secondary Act (ESEA), as amended,
  at the school, LEA, and state levels. EDFacts T1:2011-12 data were collected using
  the EDFacts Submission System (ESS), a centralized portal and their submission by
  states is mandatory and required for benefits. Not submitting the required reports
  by a state constitutes a failure to comply with law and may have consequences for
  federal funding to the state. Key statistics produced from EDFacts T1:2011-12 are
  from 18 data groups with information on Economically Disadvantaged Students, School
  Poverty Indicator, Public School Choice - Eligible, Public School Choice - Applied
  for Transfer, Public School Choice - Transferred, Public School Choice - Implementation,
  Public School Choice - 20% Transportation Reservation, Public School Choice - Funds
  Spent, SES - Applied to Receive Services, SES - Eligible to Receive Services, SES
  - Funds Spent, SES - Per Pupil Expenditure, SES - Received Services, Title I Part
  A Participation, Title I Status, Title I Part A SWP/TAS Participation, Title I TAS
  Staff Funded (FTE), Title I Part A TAS. For the purposes of this system, data groups
  are referred to as 'variables', as a result of the structure and format of EDFacts'
  data.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\": [{\n\t\t\"key\":
